  \"2015-07-08T19:12:54.883129\",\n\t\"name\": \"global-landslide-hazard-distribution\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Global Landslide Hazard Distribution is
  a 2.5 minute grid of global landslide and snow avalanche hazards based upon work
  of the Norwegian Geotechnical Institute (NGI). The hazards mapping of NGI incorporates
  a range of data including slope, soil, soil moisture conditions, precipitation,
  seismicity, and temperature. Shuttle Radar Topography Mission (SRTM) elevation data
  at 30 seconds resolution are also incorporated. Hazards values 4 and below are considered
  negligible and only values 5 through 9 are utilized in further analyses. To ensure
  compatibility with other datasets, 1 is added to each of the values to provide a
  hazard ranking ranging 6 through 10 in increasing hazard. This dataset is the result
  of collaboration among the Columbia University Center for Hazards and Risk Research
  (CHRR), Norwegian Geotechnical Institute (NGI), and Columbia University Center for
  International Earth Science and Information Network (CIESIN).\",\n\t\"license_title\":
